1	e028684282e74286aaf3bc443c138e2a 	Puma Platform Suede Core in White	1-e0286	<p>Born in the late '60s and rocked by generations, the Suede is arguably PUMA’s most iconic sneaker. Today, we’re taking its sport-inspired swagger to new heights (literally) with the Suede Platform. A women’s-only silhouette, it boasts a thick platform sole, ridged tooling, and plenty of edge. It’s a gamechanger of a sneaker… for women who are ready to change the game.</p><ul><li>Suede upper with perf detailing at midfoot</li><li>Lace closure for a snug fit</li><li>Platform rubber outsole with ridged tooling at toe</li><li>PUMA Formstrip at lateral and medial sides</li><li>PUMA Suede callout in metallic foil at lateral side</li><li>Woven PUMA Logo Label at tongue</li></ul>	<p>Born in the late '60s and rocked by generations, the Suede is arguably PUMA’s most iconic sneaker. Today, we’re taking its sport-inspired swagger to new heights (literally) with the Suede Platform. A women’s-only silhouette, it boasts a thick platform sole, ridged tooling, and plenty of edge. It’s a gamechanger of a sneaker… for women who are ready to change the game.</p><ul><li>Suede upper with perf detailing at midfoot</li><li>Lace closure for a snug fit</li><li>Platform rubber outsole with ridged tooling at toe</li><li>PUMA Formstrip at lateral and medial sides</li><li>PUMA Suede callout in metallic foil at lateral side</li><li>Woven PUMA Logo Label at tongue</li></ul>	\N	t	2017-10-02 11:36:40.497	2017-10-02 11:36:40.497	1
2	0d5d09f4ab5149b6be98184ae7855320 	Puma Platform Suede Core in Black	2-0d5d0	<p>Born in the late '60s and rocked by generations, the Suede is arguably PUMA’s most iconic sneaker. Today, we’re taking its sport-inspired swagger to new heights (literally) with the Suede Platform. A women’s-only silhouette, it boasts a thick platform sole, ridged tooling, and plenty of edge. It’s a gamechanger of a sneaker… for women who are ready to change the game.</p><ul><li>Suede upper with perf detailing at midfoot</li><li>Lace closure for a snug fit</li><li>Platform rubber outsole with ridged tooling at toe</li><li>PUMA Formstrip at lateral and medial sides</li><li>PUMA Suede callout in metallic foil at lateral side</li><li>Woven PUMA Logo Label at tongue</li></ul>	<p>Born in the late '60s and rocked by generations, the Suede is arguably PUMA’s most iconic sneaker. Today, we’re taking its sport-inspired swagger to new heights (literally) with the Suede Platform. A women’s-only silhouette, it boasts a thick platform sole, ridged tooling, and plenty of edge. It’s a gamechanger of a sneaker… for women who are ready to change the game.</p><ul><li>Suede upper with perf detailing at midfoot</li><li>Lace closure for a snug fit</li><li>Platform rubber outsole with ridged tooling at toe</li><li>PUMA Formstrip at lateral and medial sides</li><li>PUMA Suede callout in metallic foil at lateral side</li><li>Woven PUMA Logo Label at tongue</li></ul>	\N	t	2017-10-02 11:36:40.564	2017-10-02 11:36:40.564	1
3	b1a618ff51744a7387dcaecc16a4cb7f 	Puma Suede Classic in Black	3-b1a61	<p>Back in 1968, the city scene was packed with hot chicks in hot pants and tall boys in basketball shorts. That was when PUMA first lit a fire under culture&rsquo;s keister with the Suede silhouette. The industry rebel that said &ldquo;nay&rdquo; to ordinary leather, the Suede was a warm-up shoe made infamous by athletic greats such as basketball&rsquo;s Walt &ldquo;Clyde&rdquo; Frazier and the track&rsquo;s Tommie Smith. It hit new levels of fame during the '80s dawn of b-boys and hip hop beats, taking over New York City blocks. And to this day, it remains PUMA&rsquo;s most epic icon of sport-inspired style with its smooth suede and streetwise swagger.</p>\r\n<ul>\r\n<li>Women&rsquo;s-specific last</li>\r\n<li>Suede upper with perforated detailing at midfoot</li>\r\n<li>Lace closure for a snug fit; packaged with two lace color options</li>\r\n<li>Breathable EcoOrthoLite&reg; sockliner for optimum fit and comfort</li>\r\n<li>Grippy rubber outsole</li>\r\n<li>PUMA Formstrip at lateral and medial sides</li>\r\n<li>PUMA branding at lateral side</li>\r\n<li>Woven PUMA Logo label at tongue, with PUMA Cat Logo at heel</li>\r\n</ul>	<p>Back in 1968, the city scene was packed with hot chicks in hot pants and tall boys in basketball shorts. That was when PUMA first lit a fire under culture’s keister with the Suede silhouette. The industry rebel that said “nay” to ordinary leather, the Suede was a warm-up shoe made infamous by athletic greats such as basketball’s Walt “Clyde” Frazier and the track’s Tommie Smith. It hit new levels of fame during the '80s dawn of b-boys and hip hop beats, taking over New York City blocks. And to this day, it remains PUMA’s most epic icon of sport-inspired style with its smooth suede and streetwise swagger.</p><ul><li>Women’s-specific last</li><li>Suede upper with perforated detailing at midfoot</li><li>Lace closure for a snug fit; packaged with two lace color options</li><li>Breathable EcoOrthoLite® sockliner for optimum fit and comfort</li><li>Grippy rubber outsole</li><li>PUMA Formstrip at lateral and medial sides</li><li>PUMA branding at lateral side</li><li>Woven PUMA Logo label at tongue, with PUMA Cat Logo at heel</li></ul>	\N	t	2017-10-02 11:36:40.6	2017-10-02 11:36:40.6	1
4	ace9973118294ff2ace737790d852447 	The Made in Canada Signature T-Shirt in Charcoal	4-ace99	<p>Sorry to bother you but we just wanted to share with you our brand new, made-in-Canada, Signature T-shirt, which features some pretty sharp embroidery on the chest. This particular t-shirt was locally manufactured just down the street from us in the centre of Montreal's garment district from soft, eco-friendly cotton. It also fits really nicely. Sorry, maybe that's more information than you cared for. Sorry, bud.</p>\n<ul>\n<li>Slim fit</li>\n<li>Embroidered emblem</li>\n<li>100% cotton</li>\n</ul>	<p>We are a family here at Frank + Oak, and you all are a big part of the equation. For our fifth birthday, join the team in spirit with our anniversary logo tee. Don't miss out - you never know how much this memorabilia will be worth in another five years.</p><ul><li>Slim fit</li><li>Embroidered emblem</li><li>100% cotton</li></ul>	\N	t	2017-10-02 11:36:40.67	2017-10-02 11:36:40.67	1
