8	9745dc89fd994bf98be0f0caad376877 	The Odessa Chambray Shirt in Burgundy	8-9745d	<p>Comfortable enough to rival an old favourite tee or worn in denim shirt, this soft chambray button-up has casual appeal in a sophisticated package.</p><ul><li>Classic slim fit</li><li>Button-down collar</li><li>100% cotton</li></ul>	Men-Casual Shirts L/S Odessa Chambray - Solid	\N	t	2017-10-02 11:36:40.81	2017-10-02 11:36:40.81	1
